import { REQUEST_GENDER } from "./../actions/types";

function genderReducer(state = [], action) {
  switch (action.type) {
    case REQUEST_GENDER:
      console.log("test gender")
      console.log(action.payload)
      return action.payload;
    default:
      return state;
  }

}
export default genderReducer;
